    const fetchProductDetail = async () =>{
        const response = await axios
        .get(`https://fakestoreapi.com/products/${productId}`)
        .catch(err => {})
        console.log("Err",err)
    }
    return(
        <div>
            <h1>ProductDetail</h1>
        </div>
    )
}

